column2:
What is printed to console.log?

var s = "hello";
console.log(s.split());

What is printed to console.log?

var p = {
    i: 42
};
var o = Object.create(p, {
    i: {
        value: 24
    }
});
console.log(o.i);

What is printed to console.log?

Object.prototype.test = 42;
var o = { i: 84 };
for (var p in o) {
    console.log(p, o[p]);
}

What is printed to console.log?

var o = { i: 84 };
Object.freeze(o);
o.i = 42;
console.log(o.i);

What is printed to console.log?

var o = {i: 42, j: 84, k: 100};
var k = Object.keys(o);
var total = 0;
for (var i = 0; i < k.length; i++) {
    total += o[k[i]];
}
console.log(total);

Which of the answers is equivalent to the following:

var f = function (i) {
    return i;
};

What is printed to console.log?

var Animal = function (name) {
    var speak = () => name || "Bob"
    this.speak = speak;
}
var cat = new Animal("Tom");
console.log(cat.speak());

Which of the answers is equivalent to the following:

class Animal {
    constructor(i) {
        this.i = i;
    }
}

What is printed to console.log?

class Animal {
    constructor(name) {
        this.name = name || "Fido";
    }
    toString() {
        return "My name is: " + this.name;
    }
}
var cat = new Animal();
console.log("" + cat);

What is printed by console.log?

var f = function (x, ...y) {
  console.log(y);
}
f(1, 2, "cat", 3)

What is printed by console.log?

var f = function () {
    const x = 42;
    var a = 24;
    x = 100;
    console.log(a, x);
};

What will be printed by console.log?

var f = function*() {
    for (var i = 0; i < 10; i++) {
        yield i;
    }
};

var a = [];
for (var i of f()) {
    a.push(i);
}
console.log(a);

What is printed to console.log?

var a = "abc";
for (let i of a) {
    console.log(i);
    break;
}

What will be printed to console.log?

var s = new Set();
s.add(42);
s.add("42");
s.add(42);
console.log(s.size);

What will be printed to console.log?

var m = new Map();
m.set(42, "Hello");
m.set("42", "World");
console.log(m.get(42), m.get("42"));

What will be printed to console.log?

var o = {
    i: 42
};
var p = {};
Object.assign(p, o);
console.log(o.i, p.i);

Starting in ECMAScript6, which of the answers is the equivalent of the following?

var f = function (a, b) {
    a = a || 42;
    b = b || 34;
    return a + b;
};

What is printed in console.log?

var s = "Hello";
console.log([...s]);

What is printed in console.log?

var o = {
    i: 42,
    j: 24
};
var { i, j } = o;
console.log(j, i);

What is printed in console.log?

var o = {
    i: 42,
    j: 24
};
var { i: a, j: b } = o;
console.log(b, a);

What is printed to console.log?

var f = function([a, b, c]) {
    return a + b + c + 100;
};
var a = [1, 2, 3];
console.log(f(a));

What is printed to console.log?

(function() {
    console.log(1);
    setTimeout(function(){console.log(2)}, 1000);
    setTimeout(function(){console.log(3)}, 0);
    console.log(4);
})();

What is printed to console.log?

(function() {
    var i = 0;
    var id = setTimeout(function () {
        i += 1;
        if (i <= 5) {
            setTimeout(arguments.callee, 10);
        }
    }, 10);
    console.log(i);
})();

What is printed to console.log?

var Animal = function (color) {
    this.color = color || "Brown";
    this.speak = function () {
        console.log(this.color);
    };
};
var dog = new Animal("Black");
setTimeout(dog.speak, 10);

What is printed to console.log?

var n = 24;
var p = new Promise(function (resolve, reject) {
    resolve(100);
});
p.then(function (i) {
    n = i;
    return 42;
}).then(function (i) {
    n = i;
    throw new Error();
}).catch(function () {
    console.log(n);
});
console.log(n);

What is printed to console.log?

var n = 1;
var pgen = function () {
    n += 1;
    return Promise.resolve(n);
};
Promise.all([pgen(), pgen(), pgen()])
.then(function (answers) {
    console.log(answers[0], answers[1], answers[2]);
});

What is printed to console.log?

Promise.all([Promise.resolve(1), Promise.reject(new Error("Error!")), Promise.resolve(3)])
.then(function (answers) {
    console.log(answers[0], answers[1], answers[2]);
})
.catch(function (e) {
    console.log(e.message);
});

What is printed to console.log?

var g = (function f(f){
   return f;
})(function(){ return 42; });
console.log(g(84));

What is printed to console.log?

var wrap = function (f) {
    return function () {
        return 42 + f();
    };
};
var f = function () {
    return 42;
};
f = wrap(f);
console.log(f(100));

What is printed to console.log?

var wrap = function (f) {
    return function () {
        var args = Array.prototype.slice.call(arguments);
        args = args.reverse();
        return f.apply(null, args);
    };
};
var f = function (a, b, c) {
    return a * b + c;
};
f = wrap(f);
console.log(f(1, 2, 3));

What is printed to console.log?

var f = function () {
    return this.name;
};

var o = {
    name: "Mo"
};

var o2 = {
    name: "Mo Jr."
};

var g = f.bind(o);
o2.name = g;
console.log(o2.name());

What is printed to console.log?

var f = function (a, b) {
    return this.name + " " + a + " " + b;
};

var o = {
    name: "Mo"
};

var g = f.bind(o, "says", "hi");
console.log(g());

What is printed to console.log?

var f = function () {
    if (!console) {
        var console = {};
        console.log = function () {
            return 42;
        }
    }
    console.log(100);
};
f();

What is printed to console.log?

var f = function (i) {
    return function (i) {
        return i;
    };
};

var g = f(42);
console.log(g(84));

What is printed to console.log?

var Animal = function (name) {
    this.name = name || "Fido";
    this.speak = () => this.name;
};

var dog = new Animal();

var otherDog = {
    name: "Not Fido",
    speak: dog.speak
};
console.log(otherDog.speak());

What is printed to console.log?

var x = 42;
(function () {
    var x = 24;
    var f = function () {
        x = 84;
    };
    (function () {
        f();
        console.log(x);
    })();
})();
console.log(x);

What is printed to console.log?

(function () {
    for (var i = 0; i < 10; i++) {
        var a = i;
    }
    console.log(i);
})();

What is printed to console.log?

var n = null;
var u = undefined;
var f = function () {};
console.log(typeof n, typeof u, typeof f);

Assuming a browser environment, what is printed to console.log?

window.onload = function () {
    console.log(42);
};
var ev1 = function () {
    console.log(84);
};
window.addEventListener("load", ev1);

Assuming a browser environment, what is printed to console.log?

window.onload = function () {
    console.log(42);
};
var ev1 = function () {
    this.removeEventListener("load", ev2);
};
var ev2 = function () {
    console.log(84);
}
window.addEventListener("load", ev1);
window.addEventListener("load", ev2);

What is printed to console.log?

var i = 42;
var j = NaN;
var k = 84;
var s = (function () {
    if (j > 0) {
        return i + j + k;
    } else {
        return i + k;
    }
})();
console.log(s);

What is printed to console.log?

var Animal = function (name) {
    this.name = name || "Fido";
};
var methods = {
    speak: function () {
        return this.name || "Cat";
    }
};
var cat = new Animal("Dog");
for (var m in methods) {
    cat[m] = methods[m];
}
console.log(cat.speak());

What is printed to console.log?

var Animal = function (name) {
    this.name = name || "Fido";
};
Animal.prototype.speak = function () {
    return this.name;
};

var Cat = function (name) {
    Animal.call(this, name);
    name = name || "Gato";
};
Cat.prototype = new Animal();

var cat = new Cat("Red");
console.log(cat.speak());

What is printed to console.log?

var Animal = function (name) {
    this.name = name || "Fido";
};
Animal.prototype.speak = function () {
    return this.name;
};

var Cat = function (name) {
    name = name || "Gato";
};
Cat.prototype = new Animal();

var cat = new Cat("Red");
console.log(cat.speak());

What is printed to console.log?

var speech = function () {
    var args = Array.prototype.slice.call(arguments);
    var words = args.map(function (w, i) {
        return i % 2 === 0 ? "CENSORED" : w;
    });
    return words.join(" ");
};
console.log(speech("Hello", "world", "what's", "up?"));

What is printed to console.log?

var speech = function () {
    var args = Array.prototype.slice.call(arguments);
    var words = args.filter(function (w, i) {
        return i % 2;
    });
    return words.join(" ");
};
console.log(speech("Hello", "world", "what's", "up?"));

Assuming a browser environment, what is printed to console.log?

var Animal = function () {
    this.name = "Fido";
};
var dog = Animal();
console.log(window.name, dog);
